import React from "react";

export const Tile = (props) => {
  return (
    <div className="tile-container">
      <p className="tile-title">{props.name}</p>
      <p className="tile">{props.description}</p>
    </div>
  );
};

{props.description.map((item) => {
  return (
    <p>{item}</p>
  )
})}
